(1, 1, '2020-01-03', 7, '<p><strong>Acessos:</strong> N&atilde;o houve solicita&ccedil;&atilde;o de visita aos DC&rsquo;s.</p>\r\n\r\n<p><strong>Checklist:&nbsp;</strong>Em todos os datacenters meu acesso estava bloqueado (Negado permiss&atilde;o). Somente portarias e refeit&oacute;rio com acesso liberado.</p>\r\n\r\n<p><strong>Alertas (Zabbix):</strong> Diversos alertas durante o turno, a maioria com s&iacute;mbolo de manuten&ccedil;&atilde;o, reconhecidos ou resolvidos dentro do tempo padr&atilde;o:</p>\r\n\r\n<p>0 e-mail(s) enviado(s) com o total de 0 alerta(s):</p>\r\n\r\n<ul>\r\n	<li>0 Alerta(s) ativo(s);</li>\r\n	<li>0 Alerta(s) resolvido(s).</li>\r\n</ul>\r\n'),
(2, 2, '2020-01-03', 2, '<p><strong>Acessos:</strong>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><u>TR:</u> Anderson da N&amp;C para realizar a manuten&ccedil;&atilde;o na fibra que interliga Supplier Park com a Pintura 02.</li>\r\n</ul>\r\n\r\n<p><strong>Checklist:</strong> Observa&ccedil;&otilde;es anteriores permanecem. Acesso liberado em todos os Data Centers, menos na P4.</p>\r\n\r\n<p><strong>Alertas (Zabbix):</strong>&nbsp;Diversos alertas durante o&nbsp;turno, a&nbsp;maioria com s&iacute;mbolo de manuten&ccedil;&atilde;o, reconhecidos ou resolvidos dentro do tempo padr&atilde;o:</p>\r\n\r\n<p>0 e-mail(S) enviado(s) com o&nbsp;total de 0 alerta(s):</p>\r\n\r\n<ul>\r\n	<li>0 Alerta(s) ativo(s);</li>\r\n	<li>0 Alerta(s) resolvido(s).</li>\r\n</ul>\r\n\r\n<p>Obs: Davi autorizou o pessoal da N&amp;C pegar o No-Break e levar para a sala deles.&nbsp;</p>\r\n'),
