(289, 2, '2020-06-03', 4, '<p><span style=\"font-size:12px\"><strong><u>&gt;&gt; Acessos: </u></strong></span><!--<span--><br />\r\n<span style=\"font-size:11px\">N&atilde;</span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><strong><u><span style=\"font-size:10.0pt\">&gt;&gt; 2&ordm; Ribeiro - Acesso</span></u></strong></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-size:10.0pt\">Houve o Acessos neste turno, ao DC FCA, do Sr. Hirata da DELLEMC, para Fazer a troca da Unidade de Disco R&iacute;gido do Rack 07, Autorizado pelo Sr. Davi Barros.<br />\r\n------------------------------------------------------------<br />\r\n<strong><u>&gt;&gt; Checklist:</u></strong><br />\r\n<strong><em>DC FCA:</em></strong><br />\r\nRack 7 foi trocado a Unidade de Disco R&iacute;gido, n&atilde;o apresenta mais problema de alerta.<br />\r\n<strong><em>DC do Supplier:</em></strong><br />\r\nRack do FCA com a porta traseira aberta (Aguardando resposta da equipe da N&amp;C);<br />\r\n<strong><em>DC DR:</em></strong><br />\r\nRack 02 com a porta dianteira aberta (O switch nexus n&atilde;o deixa fechar a porta).<br />\r\n<strong><em>Sala t&eacute;cnica:</em></strong><br />\r\nSomente 2 ar condicionados ligados;<br />\r\nAlgumas tampas do piso e do teto continuam deslocadas;<br />\r\nExtintor mal localizado e necessitando de vistoria;<br />\r\nUPS desligada;<br />\r\nInfiltra&ccedil;&atilde;o no teto (aguardando a Omini), C<strong>hamado&nbsp;&nbsp;ID44571&nbsp;para Concertar o Ar - Condicionado da nossa sala que esta pingando, J&aacute; foi atendido pela Equipe Eleva, tudo normalizados, Funcionamento OK </strong></span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-size:10.0pt\">------------------------------------------------------------<br />\r\n<strong><u>&gt;&gt; Alertas (ZABBIX):</u></strong><br />\r\n&nbsp;- 0&nbsp;e-mail enviado(s) com 0&nbsp;alerta(s);&nbsp;<br />\r\n&nbsp;- 0&nbsp;Alerta(s) ativo(s);&nbsp;<br />\r\n&nbsp;- 0 Alerta(s)