(290, 1, '2020-06-04', 12, '<p><span style=\"font-size:12px\"><strong><u>&gt;&gt; Acessos: </u></strong></span><!--<span--><br />\r\n<span style=\"font-size:11px\">N&atilde;o houveram acessos neste turno.</span><br />\r\n<span style=\"font-size:12px\"><strong><u>&gt;&gt; Checklist:</u></strong></span><!--<span--><br />\r\n<span style=\"font-size:11px\"><strong>DC FCA:&nbsp;&nbsp; &nbsp;</strong><br />\r\n1. No rack 02 todos os equipamentos est&atilde;o desligados.</span><br />\r\n<span style=\"font-size:11px\"><strong>DC SP:</strong><br />\r\n1. Rack Jeep com a porta traseira semi-aberta por causa da fibra que impede o fechamento<br />\r\n2. Um dos geradores sem funcionar<br />\r\n3. Ar-condicionado 1 est&aacute; desligado para manuten&ccedil;&atilde;o.</span><br />\r\n<span style=\"font-size:11px\"><strong>DC DR:</strong><br />\r\n1. Rack 02 com porta dianteira aberta.</span><br />\r\n<span style=\"font-size:11px\"><strong>DC TR:</strong><br />\r\n1. Racks abertos e sem portas<br />\r\n2. Algumas tampas do piso e do teto continuam deslocadas desde o servi&ccedil;o de passagem de fibra realizado anteriormente<br />\r\n3. Lumin&aacute;ria fora do lugar<br />\r\n4. Somente 2 ar-condicionados funcionando<br />\r\n5. Extintor mal localizado e necessitando de vistoria<br />\r\n6. UPS desligada<br />\r\n7. Infiltra&ccedil;&atilde;o no teto.</span><br />\r\n<span style=\"font-size:11px\"><strong>OBS NPO:</strong><br />\r\n1.No carro o espelho do retrovisor esquerdo est&aacute; quebrado. (J&Aacute; COMPRADO, FALTA S&Oacute; COLOCAR)</span><br />\r\n<span style=\"font-size:12px\"><strong><u>&gt;&gt; Alertas (ZABBIX): </u></strong></span><br />\r\n<span style=\"font-size:11px\">&nbsp;- 0 e-mail enviado(s) com 0 alerta(s);&nbsp; </span><!--<span--><br />\r\n<span style=\"font-size:11px\">&nbsp;- 0 Alerta(s) ativo(s);&nbsp;<br />\r\n&nbsp;- 0 Alerta(s)</span><br />\r\n<span style=\"font-size:12px\"><strong><u>&gt;&gt; Observa&ccedil;&otilde;es:</u></strong></span><br />\r\n<spa